import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./smallparks.json";
import "./ParkPage.css";

class ParkPage extends Component {
  render() {
    let AllParkDetails = Parks.map(park => {
      return <div className="parkpage-container" />;
    });

    let ParkImages = Parks.map(park => {
      return park.images.map(image => {
        return <img src={image.url} className="ImageBox" />;
      });
    });

    return (
      <div className="pagegrid">
        <div classname="ParkInfo">{AllParkDetails}</div>
        <div classname="ParkImages">{ParkImages}</div>
      </div>
    );
  }
}

export default ParkPage;
